Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable.Map

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder().appName("HitRateCalculator").getOrCreate()

    // Load onsite attributed data
    val onsiteData = spark.read.format("csv").option("header", "true").load("onsite_data.csv")
      .select("query", "timestamp")
      .rdd
      .map(row => (row.getString(0), row.getLong(1)))

    // Load top frequent queries
    val topQueries = spark.read.format("csv").option("header", "true").load("top_queries.csv")
      .select("query")
      .rdd
      .map(row => row.getString(0))
      .collect()
      .toSet

    // Broadcast top queries to all nodes
    val broadcastTopQueries: Broadcast[Set[String]] = spark.sparkContext.broadcast(topQueries)

    // Initialize cache
    val cache = Map[String, (Long, Boolean)]()

    // Process onsite data
    val hitRate = onsiteData.mapPartitions(iter => {
      val cacheMap = Map[String, (Long, Boolean)]()
      iter.map { case (query, timestamp) =>
        if (broadcastTopQueries.value.contains(query)) {
          if (cacheMap.contains(query)) {
            val (lastAccessTime, isCached) = cacheMap(query)
            if (!isCached || (timestamp - lastAccessTime) > 12 * 60 * 60 * 1000) {
              // Cache miss, update cache
              cacheMap.put(query, (timestamp, true))
              (query, false)
            } else {
              // Cache hit
              (query, true)
            }
          } else {
            // First time query, cache miss
            cacheMap.put(query, (timestamp, true))
            (query, false)
          }
        } else {
          // Query not in top queries, ignore
          (query, true)
        }
      }
    }).reduce((a, b) => (a._1 + b._1, a._2 + b._2))

    // Calculate hit rate
    val hitRateValue = hitRate._2.toDouble / hitRate._1
    println(s"Hit rate: $hitRateValue")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries from CSV files. It then broadcasts the top queries to all nodes in the cluster. The cache is initialized as an empty mutable map.

The job then processes the onsite data using the `mapPartitions` transformation. For each partition, it initializes a local cache map and processes each record in the partition. If the query is in the top queries, it checks if it is already in the cache. If it is, it checks if the query has been cached for more than 12 hours. If it has, it updates the cache and returns a cache miss. If it hasn't, it returns a cache hit. If the query is not in the cache, it adds it to the cache and returns a cache miss. If the query is not in the top queries, it ignores it.

The job then calculates the hit rate by summing up the number of cache hits and misses and dividing the number of hits by the total number of queries processed. The hit rate is then printed to the console.

